function main() {
    var JSONWordsArray = parseWordsToJSONArray();
    var word = chooseRandomWord(JSONWordsArray).toUpperCase();
    setPhraseTable(word);

    addEventListenerToLetterContainer(word);

    addEventListenerToResetButton();
}

function addEventListenerToResetButton() {
    document.querySelector(".reset-button").addEventListener("click", () => {
        location.reload();
    });
}

function chooseRandomWord(JSONWordsArray) {
    return JSONWordsArray[parseInt(Math.random() * JSONWordsArray.length)].word;
}

function setPhraseTable(word) {
    var characters = word.split("");

    var wordTableRow = document.querySelector(".word-table tr");

    for (let character of characters) {
        if (character == " ") {
            wordTableRow.innerHTML += '<th class="rounded space-letter-th"> </th>';
        } else if (character == "'" || character == "-" || character == "_") {
            wordTableRow.innerHTML += '<th class="rounded">' + character + '</th>';
        } else {
            wordTableRow.innerHTML += '<th class="rounded">.</th>';
        }
    }
}

function addEventListenerToLetterContainer(word) {
    var letterContainer = document.querySelector(".letter-container");

    letterContainer.addEventListener("click", (event) => {
        handleGuess(event, word);
    });
}

function handleGuess(event, word) {
    var currentElement = event.target;

    if (event.target.disabled == false) {
        if (word.includes(currentElement.innerText)) {
            showGuessedCharacters(currentElement.innerText, word);
        } else {
            decreaseHealth();
        }
    
        checkStatus(word);
    }

    event.target.disabled = true;
}

function checkStatus(word) {
    var hearts = document.querySelector(".hearts-table").querySelectorAll("th");

    if (checkIfWon()) {
        setStatusWon();
    } else if (hearts.length == 0) {
        setStatusLost(word);
    }
}

function showGuessedCharacters(guessedCharacter, word) {
    var characters = word.split("");

    var wordTableRow = document.querySelector(".word-table tr");
    var wordTableCells = wordTableRow.querySelectorAll("th");

    for (let i = 0; i < characters.length; i++) {
        if (characters[i] == guessedCharacter) {
            wordTableCells[i].innerText = guessedCharacter;
        }
    }
}

function checkIfWon() {
    var wordTableRow = document.querySelector(".word-table tr");
    var wordTableCells = wordTableRow.querySelectorAll("th");

    let isWon = true;
    for (let cell of wordTableCells) {
        if (cell.innerText == ".") {
            isWon = false;
            break;
        }
    }

    return isWon;
}

function setStatusWon() {
    disableAllLetters();
    
    setCanvasStateWon();
}

function setStatusLost(word) {
    disableAllLetters();

    showWord(word);
}

function disableAllLetters() {
    var letterContainer = document.querySelector(".letter-container");
    var letters = letterContainer.querySelectorAll("button");

    for (letter of letters) {
        letter.disabled = true;
    }
}

function showWord(word) {
    var characters = word.split("");

    var wordTableRow = document.querySelector(".word-table tr");
    var wordTableCells = wordTableRow.querySelectorAll("th");

    for (let i = 0; i < characters.length; i++) {
        if (characters[i] != wordTableCells[i].innerText) {
            wordTableCells[i].innerText = characters[i];
        }
    }
}

function setCanvasStateWon() {
    hideSadStickmanParts();
    showOtherStickmanParts();
    showHappyStickmanParts();
}

function hideSadStickmanParts() {
    var sadStickmanParts = document.querySelectorAll(".sad-stickman-part");

    for (sadStickmanPart of sadStickmanParts) {
        if (sadStickmanPart.classList.contains("visible")) {
            sadStickmanPart.classList.remove("visible");
        }

        if(sadStickmanPart.classList.contains("stickman-gallows")) {
            sadStickmanPart.classList.remove("stickman-gallows");
        }
    }
}

function showOtherStickmanParts() {
    var otherStickmanParts = document.querySelectorAll(".other-stickman-part");

    for (otherStickmanPart of otherStickmanParts) {
        if (!otherStickmanPart.classList.contains("visible")) {
            otherStickmanPart.classList.add("visible");
        }
    }
}

function showHappyStickmanParts() {
    var happyStickmanParts = document.querySelectorAll(".happy-stickman-part");

    for (happyStickmanPart of happyStickmanParts) {
        if (!happyStickmanPart.classList.contains("visible")) {
            happyStickmanPart.classList.add("visible");
        }
    }
}

function decreaseHealth() {
    showASadStickmanPart();
    removeAHeart();
}

function showASadStickmanPart() {
    var inGameStickmanParts = document.querySelectorAll(".in-game-stickman-part");

    for (inGameStickmanPart of inGameStickmanParts) {
        if (!inGameStickmanPart.classList.contains("visible")) {
            inGameStickmanPart.classList.add("visible");
            break;
        }
    }
}

function removeAHeart() {
    var hearts = document.querySelector(".hearts-table").querySelectorAll("th");
    
    if (hearts.length > 0) {
        var heart = hearts[0];
        heart.parentNode.removeChild(heart);
    }
}

main();

